var tipuesearch = {"pages":[{"text":"2016Fall 修課成員網誌","tags":"misc","url":"./pages/about/","title":"About"},{"text":"An introductory tutorial is available, in which we draw the same part that is shown in the demo video. This covers most of the basic features of SolveSpace, including sketches, constraints, extrusions, and Boolean operations. When we first run SolveSpace, we will begin with an empty part. Initially, our view of the part will be oriented onto the XY plane; the label for that plane is displayed at the bottom left of the screen (#XY, in dark grey). The axes are also indicated by the three colored arrows at the bottom left; the X, Y, and Z axes are drawn in red, green, and blue respectively. When we hover the mouse over any entity, constraint, or other object in the sketch, that object will appear highlighted in yellow. For example, the XY plane, which is drawn as a dashed square, will appear highlighted when we hover the mouse over it. The YZ and ZX planes initially look like dashed lines, because they are being viewed on edge; but they still appear highlighted in yellow when we hold the mouse over them. It is similarly possible to highlight the X, Y, and Z axes (which are drawn as arrows), or the origin (which like all points is drawn as a green square). Extrude (平行長出或除料) Lathe (旋轉繞行長出或除料) 轉轉轉轉轉轉轉轉轉 Export Triangle Mesh STL 格式 kappa 2. Assembly (零件組立) 3. Linkages (fourbar & multilink) (四連桿與多連桿運動模擬) 4. Compiled & API (編譯與延伸應用) This is the end of this week!!!","tags":"Misc","url":"./w11-xue-xue-xue-xue-zhuan-zhuan-zhuan-zhuan-zhuan-zhuan.html","title":"w11 學學學學轉轉轉轉轉轉"},{"text":"Solvedpace平面4連桿模擬kappa: 用點座標在excel畫圖kappa get: 繪圖流程, 導入程式庫, 啟動, 然後引用各種模組開始繪圖 window.onload=function(){ brython(1); } from browser import document as doc import math # 準備繪圖畫布 canvas = doc[\"japanflag1\"] ctx = canvas.getContext(\"2d\") # 以下可以利用 ctx 物件進行畫圖 # 先畫一條直線 ctx.beginPath() # 設定線的寬度為 1 個單位 ctx.lineWidth = 1 # 將畫筆移動到 (100, 100) 座標點 ctx.moveTo(100, 100) # 然後畫直線到 (150, 200) 座標點 ctx.lineTo(150, 200) # 畫右上左下的斜線 ctx.moveTo(150, 100) ctx.lineTo(100, 200) # 設定顏色為藍色, 也可以使用 \"rgb(0, 0, 255)\" 字串設定顏色值 ctx.strokeStyle = \"blue\" # 實際執行畫線 ctx.stroke() ctx.closePath() This is the end of this week!!!","tags":"Misc","url":"./w10-4lian-gan-excelchao-ji-zhi-tu-yuan.html","title":"w10 4連桿Excel超級製圖員"},{"text":"超級w4~Solvespace 參數化零組件設計繪圖 網誌 Category 網誌 Tags reveal.js 使用導引","tags":"Misc","url":"./2016fallcadpzhi-solvespace-can-shu-hua-ling-zu-jian-she-ji-hui-tu-zhi-i-will-be-hokage.html","title":"2016FallCADP之~Solvespace 參數化零組件設計繪圖之~I will be HOKAGE!!"},{"text":"這是這禮拜的拼裝核4大怪獸四連木旱 這是棒棒圖檔 -可以點來看 P.S都沒人幫我點讚霸脫進來幫我點讚!!! This is the end of this week!!!","tags":"Misc","url":"./w7pin-zhuang-he-4da-guai-shou-si-lian-mu-han-zhi-ke-yi-bang-wo-ni-de-ming-zi-de-tong-ren-zuo-hua-an-zan-ma-ba-tuo.html","title":"w7拼裝核4大怪獸四連木旱之---可以幫我\"你的名字\"的同人作畫按讚嗎霸脫"}]};